import React from 'react';
import { withStyles } from '@material-ui/core/styles';

const styles = {
  root: {
    position: 'absolute',
    left: '0',
    top: '0',
    width: '312px'
  }
};


const SiteLogo = props => {
  const { classes } = props;

  return (
    <img className={classes.root} src="https://www.irishlife.ie/sites/retail/files/images/IL_Shard.svg" alt="Irish Life logo"/>
  );
};


export default withStyles(styles)(SiteLogo);
